text:
Turn, Fortune, turn thy wheel, and lower the proud;
For they have soared too high, and need to be brought down.
Their arrogance has blinded them, they stand so tall and loud;
But soon they'll feel the weight of fate, and their downfall will be found.

With every turn of your fickle wheel,
Their power and success will slowly peel.
For in their hearts, they never learned to be humble;
And now they'll taste the bitter fruit of their stumble.

They thought they were untouchable, above the rest;
But little did they know, their pride would be their test.
They looked down upon the weak and the small,
But now they'll see how easily they can fall.

